import { ReactElement, useEffect, useState } from 'react';
import { IUser, OcurrenceRecord } from '../interfaces/IUser';
import api from '../services/api';
import {getUser} from '../services/api_services';
import './InfoUser.css'

export interface IRowsInfo {
  datatime?: any;
  data?: any;
  text: String;
}

export function RowsInfo (props: IRowsInfo) {


  return (
    <div className='row justify-content-between'>
      <div className='col text-end'>
        <strong>{props.text}:</strong>
      </div>

      <div className='col text-start'>
        {props.data == null ? props.datatime :  props.data  }
      </div>
    </div>
  )
}



export interface IInfoUserProps {

}

export function InfoUser (props: IInfoUserProps) {

  const [user, setUser] = useState<IUser>();

  var url = window.location.href[window.location.href.length -1]
  api
      .get("/v1/Users/" + url)
      .then((response) => ((setUser(response.data))))
      .catch((err) => {
        console.error("ops! ocorreu um erro" + err);
      });



  function OcurrenceGet(){

    const [ocurrencesUser, setOcurrenceUser] = useState([]);

    api
      .get("/v1/Accounts/" + user?.account.numberAccount+ "/OcurrencesRecord/Statement")
      .then((response) => ((setOcurrenceUser(response.data))))
      .catch((err) => {
        console.error("ops! ocorreu um erro" + err);
    });

    return ocurrencesUser;
  }

  const ocurrences : Array<ReactElement> = [];

  OcurrenceGet().forEach((o: OcurrenceRecord) => {
    ocurrences.push(
      <div className='card m-2 p-2 shadow'>
        <div className='card-title row justify-content-between p-2 '>
          {o.typeRecord == 1? 
            <div className='col text-start text-success'>Credito</div>
          : 
            <div className='col text-start text-danger'>Debito</div>
          }
          <div className='col text-start'>{o.typeRecord == 1? 'Credito': 'Debito'}</div>
          <div className='col text-end date-ocurrence'>{o.createdAt.toLocaleString()}</div>
        </div>
        <div className='row'> 
          <div className='col'>
            <RowsInfo text={'Id'} data={o.id}/>
            <RowsInfo text={'Tipo'} data={o.typeRecord == 1? 'Credito': 'Debito'}/>
          </div>
          <div className='col'>
            <RowsInfo text={'Id Conta'} data={o.id}/>
            <RowsInfo text={'Valor'} data={'R$ ' + o.amount}/>
          </div>
        </div>
      </div>



    )
  })




  return (
    <div className='body'>
      <div className='card py-2' style={{backgroundColor: '#434343'}}>  
        <div className='card-header bg-transparent'>
          <div className='card-title text-white text-start fs-5'>
            Cliente: {user?.name}
          </div>
        </div>
        <div className='card-body-info bg-white pt-3'>
          <h3>Informações</h3>
          <div className='row py-3'>
            <div className='col card mx-4 shadow '>
              <div className='col-12 pt-3'><h5>Pessoais</h5><hr className='mb-1'/></div>
                <RowsInfo text={'Id'} data={user?.id}/>
                <RowsInfo text={'Name'} data={user?.name}/>
                <RowsInfo text={'Telefone'} data={user?.phone}/>
            </div>
            <div className='col card mx-4 shadow'>
              <div className='col-12 pt-3'><h5>Conta</h5><hr  className='mb-1'/></div>
                <RowsInfo text={'Id'} data={user?.account.id}/>
                <RowsInfo text={'User id'} data={user?.account.userId}/>
                <RowsInfo text={'Numero'} data={user?.account.numberAccount}/>
                <RowsInfo text={'Saldo'} data={user?.account.balance}/>
                <RowsInfo text={'Data abertura'} datatime={user?.account.openingAt}/>
            </div>
          </div>
          <h3 className='py-3'>Movimentações</h3>
          {ocurrences}
        </div>
        <div className=''></div>
      </div>
    </div>
  );
}
